import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import RoundedImage from "react-rounded-image";
import SidebarImage from './images/logo192.png';


class SideBar extends React.Component {
  render() {
    const sidebarStyle = {
      color: "black",
      backgroundColor: "white", 
      padding: "10px",
      fontFamily: "Arial",
      width: 200,
      height: 600,
    }
    return (
      <div className="sidebar" style={sidebarStyle}>
        <RoundedImage
           image={SidebarImage}
           imageWidth="150"
           imageHeight="150"
           roundedSize="13"
        />

        <div>
          <h3>Software Engineer</h3>
          <h6>B.S. Computer Science - Stony Brook University</h6>
        </div>


        <div>Welcome! I'm a recent Computer Science graduate from Stony Brook University (go Seawolves!) I </div>

        <div> <b>Links</b> <br/>
        </div>

    </div>
    );
  }
}

class HomeScreen extends React.Component {
  render() {
    return <div className="home_screen">
      <SideBar />
    </div>
  }
}



ReactDOM.render(
  <HomeScreen />, 
  document.getElementById('root')
);
